import Sidebar from "../Components/Sidebar";
import Mainbar from "../Components/Mainbar";
import AddMenu from '../../menu/Menu';

function User() {
  return (
    <div >
      <main main className="flex bg-slate-100">
        <div className="shadow-2xl  flex-[2] ">
          <Sidebar />
        </div>

        <div className="mx-3 flex-[9]">
          <Mainbar />
          <AddMenu></AddMenu>
        </div>
      </main>
    </div>
  );
}

export default User;
